import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';


const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})

const deletes = `
var output = (function(x) {
 delete x;
 return x;
})(0);

console.log(output);
`.trim()

const objCreate = `
var Employee = {
  company: 'xyz'
}

var emp1 = Object.create(Employee);
console.log(emp1.company);

delete emp1.company
console.log('After', emp1.company);
 `.trim()

const code = `(function(){
  var a = b = 3;
 })();

 console.log("a defined? " + (typeof a !== 'undefined'));                                         //False
 console.log("b defined? " + (typeof b !== 'undefined'));                                         //True
 `.trim()

const code_2 = `function foo1(){
  return {
  bar: "hello"
  };
 }

 function foo2(){
  return
  {
  bar: "hello"
  };
 }

 console.log("foo1 returns:",foo1());
 console.log("foo2 returns:",foo2());`.trim()

const code_4 = `function sum(x, y) {
  if (y !== undefined) {
  return x + y;
  } else {
  return function(y) { return x + y; };
  }
 }

 console.log(sum(2,3));
 console.log(sum(2)(3));`.trim()

const code_5 = `var list = readHugeList();
var nextListItem = function() {
 var item = list.pop();

 if (item) {
 // process the list item...
 nextListItem();
 }
};`.trim()

const code_6 = `
//1
for (let i = 0; i < 3; i++) {
  setTimeout(() => {
    console.log(i);
  }, 1000);
}


//2
for (var i = 0; i < 3; i++) {
  setTimeout(() => {
    console.log(i);
  }, 1000);
}
`.trim()

